import React,{Component} from 'react';
import './HomePage.css';

class HomePage extends Component
{
	render()
	{
			return (
				<div class="tc">
					<h1 className="f3">
					Quiz App
					</h1>
				</div>
			);
	}
}

export default HomePage;
